"
// cards are the 5 values in this 'line'
var cards = [" & Function.Param(0) & ", " & Function.Param(1) & ", " & Function.Param(2) & ", " & Function.Param(3) & ", " & Function.Param(4) & " ];

// keep track of the line index
var line = " & Function.Param(5) & ";

// the position of this card
var coordinates = '" & Function.Param(6) & "';

// Indicate the level of the win, (0 = lose) (2-5 = win)
var win = 0;

// Card value to match between the cards to indicate if we win or lose. This takes the first reel's value unless it is a wildcard, where it then takes the first non-wildcard
var value = 0;
for	(var i = cards.length-1; i >= 0; i--) {
	if (cards[i] != 0) {
		value = cards[i];
	}
}

// Here we check the value win streak to find the win level
if ((cards[0] == 0 || cards[0] == value) && (cards[1] == 0 || cards[1] == value)) {
	if (value == 0 || value == 9 || value == 10 || value == 11) {
		win = 2;
	}
	if (cards[2] == 0 || cards[2] == value) {
		win = 3;
		if ((cards[3] == 0 || cards[3] == value)) {
			win = 4;
			if ((cards[4] == 0 || cards[4] == value)) {
				win = 5;
			}
		}
	}
}

// We now return the whole result and the deets of the win
c2_callFunction('processResult',[win, value, line, coordinates, cards[0]+'-'+cards[1]+'-'+cards[2]+'-'+cards[3]+'-'+cards[4]]);"
